import React, { useState } from 'react';
import './About.css';

// Placeholder product images (you'd replace these with actual product images)
// import ProductPlaceholder1 from '../assets/product-placeholder-1.jpg';
// import ProductPlaceholder2 from '../assets/product-placeholder-2.jpg';
// import ProductPlaceholder3 from '../assets/product-placeholder-3.jpg';
// import ProductPlaceholder4 from '../assets/product-placeholder-4.jpg';
// import ProductPlaceholder5 from '../assets/product-placeholder-5.jpg';
// import ProductPlaceholder6 from '../assets/product-placeholder-6.jpg';

// // Left and Right arrow icons (replace with your actual icons)
// import LeftArrow from '../assets/icons/left-arrow.svg';
// import RightArrow from '../assets/icons/right-arrow.svg';

const ProductSlider = () => {
  // Product data
  const products = [
    {
      id: 1,
      name: "Tech Gadget Pro",
      price: "$299.99",
    //   image: ProductPlaceholder1,
      description: "Advanced technology for everyday use"
    },
    {
      id: 2,
      name: "Smart Home Hub",
      price: "$199.50",
    //   image: ProductPlaceholder2,
      description: "Connect and control your smart devices"
    },
    {
      id: 3,
      name: "Wireless Earbuds",
      price: "$149.99",
    //   image: ProductPlaceholder3,
      description: "Crystal clear sound, ultimate comfort"
    },
    {
      id: 4,
      name: "Laptop Companion",
      price: "$449.99",
    //   image: ProductPlaceholder4,
      description: "Powerful performance in a sleek design"
    },
    {
      id: 5,
      name: "Gaming Mouse",
      price: "$79.99",
    //   image: ProductPlaceholder5,
      description: "Precision engineering for gamers"
    },
    {
      id: 6,
      name: "Portable Charger",
      price: "$59.99",
      image: ProductPlaceholder6,
      description: "Never run out of battery again"
    }
  ];

  // State for current slide
  const [currentSlide, setCurrentSlide] = useState(0);

  // Handle next slide
  const handleNextSlide = () => {
    setCurrentSlide((prev) => (prev === 1 ? 0 : 1));
  };

  // Handle previous slide
  const handlePrevSlide = () => {
    setCurrentSlide((prev) => (prev === 0 ? 1 : 0));
  };

  // Get products for current slide
  const getCurrentSlideProducts = () => {
    const startIndex = currentSlide * 3;
    return products.slice(startIndex, startIndex + 3);
  };

  return (
    <section className="product-slider-section">
      <div className="product-slider-container">
        {/* Navigation Left Button */}
        <button 
          className="slider-nav-btn left-btn"
          onClick={handlePrevSlide}
        >
          <img src={LeftArrow} alt="Previous" />
        </button>

        {/* Product Slider */}
        <div className="product-slider">
          <div 
            className="product-track"
            style={{
              transform: `translateX(-${currentSlide * 100}%)`,
              transition: 'transform 0.5s ease'
            }}
          >
            {/* First Slide */}
            <div className="product-slide">
              {products.slice(0, 3).map((product) => (
                <div key={product.id} className="product-card">
                  <img src={product.image} alt={product.name} />
                  <h3>{product.name}</h3>
                  <p>{product.description}</p>
                  <div className="product-footer">
                    <span className="price">{product.price}</span>
                    <button className="add-to-cart">Add to Cart</button>
                  </div>
                </div>
              ))}
            </div>

            {/* Second Slide */}
            <div className="product-slide">
              {products.slice(3, 6).map((product) => (
                <div key={product.id} className="product-card">
                  <img src={product.image} alt={product.name} />
                  <h3>{product.name}</h3>
                  <p>{product.description}</p>
                  <div className="product-footer">
                    <span className="price">{product.price}</span>
                    <button className="add-to-cart">Add to Cart</button>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>

        {/* Navigation Right Button */}
        <button 
          className="slider-nav-btn right-btn"
          onClick={handleNextSlide}
        >
          <img src={RightArrow} alt="Next" />
        </button>
      </div>

      {/* Slide Indicators */}
      <div className="slide-indicators">
        {[0, 1].map((index) => (
          <span 
            key={index}
            className={`indicator ${currentSlide === index ? 'active' : ''}`}
            onClick={() => setCurrentSlide(index)}
          />
        ))}
      </div>
    </section>
  );
};

export default ProductSlider;
